		const memberData = {
			...enteredMemberData,
			id: Math.random().toString()
		}
	}
	return (
			<Card className={classes.users}>
				<ul>
					{
						props.members.map((member) =>
								(<li>
									이름 : {member.name}, 나이 : {member.age}
								</li>))
					}
				</ul>
			</Card>
	)
}
